// src/components/Title.js
import React from 'react';

const Title = () => {
  return (
    <div style={{
      fontSize: '1.8rem',
      fontWeight: 'bold',
      marginBottom: '0.5rem',
      textAlign: 'center'
    }}>
      DAA Project
    </div>
  );
};

export default Title;
